records.addlTxt:
9:47 AM; Case called for Plea/sentencing hearing.  Prosecuting attorney Chelsea Thompson in court for the State of Wisconsin.  Defendant Rachel Lynn Trupke in court, in custody at WCJ (on OTP from Taycheedah).  Attorney Amanda Marie Nimmer in court for Rachel Lynn Trupke.   Court notes a plea questionnaire has been filed and confirms with counsel parties are prepared to proceed to plea and sentencing today. Court recites the offer as listed on the plea questionnaire.  State and Defense confirm the offer.  Court conducts plea colloquy with the defendant. Defendant enters a guilty plea to Count 1. Court finds defendant guilty of Count 1.  Court orders Counts 2 & 3 dismissed and read in.  Court also orders case 22CF328 dismissed and read into this case.  Court will also cancel all future court dates and will order the defendant be returned to Taycheedah.

Sentencing arguments made by the State.
Sentencing arguments made by Atty. Nimmer. 
Defendant presents statements.

COUNT 1:
The Court Orders the Following:

Imposed Sentence of:

3 Years & 6 Months Imprisonment (90 Days Credit - Concurrent to any other current sentence)
-	1 Year & 6 Months of Initial Confinement
-	2 Years of Extended Supervision

Defendant is eligible for the Challenge Incarceration Program
Defendant is eligible for the Substance Abuse Program

Conditions of Extended Supervision:
-	Follow through with any treatment and/or counseling recommended by Agent;
-	Follow any conditions deemed appropriate by Agent;
-	No contact with the Co-Defendant.
-	AODA Assessment and follow through with any treatment recommended;
-	Absolute Sobriety; Random U.A.'s;
-	No Use or Possession of alcohol or illegal drugs or drug paraphernalia;
-	No use or possession of any controlled substances without a valid doctor's prescription
-	Any valid prescription drugs must be taken in the manner in which they were prescribed;
-	Inform the Agent of all prescriptions;
-	All prescriptions to be filled at the same pharmacy;
-	No contact/association with any known drug users or dealers.  

FINE or COSTS:  $268.00;

DNA Surcharge: $250.00;

DNA Sample ordered and to be provided immediately if in custody or within (3) business days at the Waukesha County Sheriff Department. 

Total costs/fine/forfeiture:  to be paid during term of imprisonment and during extended supervision. Failure to pay;  will result in a civil judgment.

Felony warnings, immigration warnings, voting rights and firearms warnings given.
